In this part we'll hook up a single handler function to a service because they look the same for each, give or take a cookie/header. We now define the HTTP handler for the service's login function. #[derive(Debug, Deserialize, Validify)]
pub struct Login { #[validate(length(min = 1))] pub username: String, #[validate(length(min = 1))] pub password: String, pub remember: bool,
} pub async fn login( State(service): State<AuthenticationService>, Json(data): Json<LoginPayload>,
) -> Result<Response<String>, Error> { let Login { username, password, remember, } = Login::validify(data).map_err(Error::new)?; let session = service.login(&username, &password, remember).await?; let session_id = session.id.to_string(); let cookie = session_cookie("S_ID", &session_id, false); MessageResponse::new("Successfully logged in") .into_response(StatusCode::OK) .with_cookies(&[cookie])? .json() .map_err(Error::new)
} // Helper for creating a cookie
pub fn session_cookie<'a>( key: &'a str, value: &'a str, expire: bool,
) -> Cookie<'a> { CookieBuilder::new(key, value) .path("/") .domain("mysupercoolsite.com") .max_age(if expire { Duration::ZERO } else { Duration::days(1) }) .same_site(SameSite::Lax) .http_only(true) .secure(true) .finish()
} The first thing we do is define the data object we intend to accept from the client. The Validify derive macro exposes a validify method for the struct. It also creates a payload struct which we use in the login handler. The first argument to this function is the service type we've defined earlier, wrapped in an axum::extractor::State. Through it we obtain a reference to the concrete service. In the next section, we'll see how we can manage state and hook everything up so we have a working application.

