First things first, we have to define the application models: pub struct User { id: Uuid, username: String, password: String, created_at: NaiveDateTime, // from chrono
} pub struct Session { id: Uuid, user_id: Uuid, created_at: NaiveDateTime, expires_at: NaiveDateTime,
} These models must be kept separate from ORM-specific entities. Any entity obtained from an ORM must be convertable to its respective application model. Here the From trait is our friend, but we will omit the implementation as it is straightforward. ORM entities are distinct (and confusingly named the same way) from our application entities, which from now on we will refer to as application models. An entity is a concept from domain driven design representing a data structure with semantic meaning to our application. Since we are dealing with authentication, the User and Session structs are the application entities as they represent core concepts from the real world. Each entity (application model) must be uniquely identifiable - as such, the ID generation for those entities must be in the hands of our app, rather than the underlying persistence implementation.

