We now define a set of interactions with a persistence layer. You can think of repositories as contracts an adapter must fulfill for it to be injected into a service. #[async_trait]
pub trait UserRepository<C> { async fn get_by_username( &self, conn: &mut C, username: &str, ) -> Result<Option<User>, AdapterError>; async fn create( &self, conn: &mut C, username: &str, password: &str, ) -> Result<User, AdapterError>;
} #[async_trait]
pub trait SessionRepository<C> { async fn get_valid_by_id( &self, conn: &mut C, id: Uuid, ) -> Result<Option<Session>, AdapterError>; async fn create( &self, conn: &mut C, user: &User, expires: bool, ) -> Result<Session, AdapterError>;
} The service will now be able utilise these definitions and in doing so won't be coupled to any particular implementation. If you're wondering why the C, we could theoretically design a repository with no generics, but it will introduce problems later down the line when we stray off the happy path.

