We now define the core authentication service struct. For the time being we will disregard the message broker requirement and focus solely on the first 2. pub struct Authentication<D, UR, SR> { driver: D, user_repo: UR, session_repo: SR,
} Since we do not know which adapters the service will be instantiated with, we must define it in terms of generics. Another option would be to define the *_repo fields using trait objects, i.e. Box<dyn UserRepository<C>>, but then we would have to introduce another generic for the connection, namely C, which arguably does not help us when we enter generics hell in the next step when defining the core functionality. We now define the login method. use hextacy::Driver; #[async_trait]
impl<D, UR, SR> Authentication<D, UR, SR>
where D: Driver + Send + Sync, D::Connection: Send, UR: UserRepository<Driver::Connection> + Send + Sync, SR: SessionRepository<Driver::Connection> + Send + Sync,
{ async fn login( &self, username: &str, password: &str, remember: bool, ) -> AppResult<Session> { let mut conn = self.repo.connect().await?; let user = match self.user_repo.get_by_username(&mut conn, username).await { Ok(Some(user)) => user, Ok(None) => return Err(AuthenticationError::InvalidCredentials.into()), Err(e) => return Err(e.into()), }; let valid = hextacy::crypto::bcrypt_verify(password, &user.password)?; if !valid { return Err(AuthenticationError::InvalidCredentials.into()); } let session = self .session_repo .create(&mut conn, &user, !remember) .await?; Ok(session) }
} In the first circle of generics hell we can observe the famous Send and Sync bounds from the async rust habitat... In the impl block's definition, we introduced the necessary generics for the service and we've bound those generics to the traits we want the service to use. We are essentially saying to the compiler " The authentication struct can use the login method if and only if its driver field implements Driver and its *_repo fields can work on the connection obtained from that driver ". The Driver trait is a completely generic trait that exposes one method - connect. It is literally just #[async_trait]
pub trait Driver { type Connection; async fn connect(&self) -> Result<Self::Connection, DriverError>;
} We need this trait because we've defined our repository to take in a generic C and now we can obtain that C from the driver. We still don't know which connection that will be - this is the whole point of the Driver trait and is how our service still remains oblivious to the adapter it will use. Because the generics are bound to repositories we get access to the necessary repository methods and can get a hold of our application models. So far, no implementation details are exposed to the service. The only thing the service is aware of is that it can create some connection and use that connection for its repositories. The real beauty of using a driver is in the next step, when we define our register method. // Same impl block as for the `login` method
async fn register(&self, username: &str, password: &str) -> AppResult<Session> { let mut conn = self.driver.connect().await?; match self.user_repo.get_by_username(&mut conn, username).await { Ok(None) => {} Ok(Some(_)) => return Err(AuthenticationError::UsernameTaken.into()), Err(e) => return Err(e.into()), }; let hashed = hextacy::crypto::bcrypt_hash(password, 10)?; let user = self.user_repo.create(&mut conn, username, &hashed).await?; let session = self.session_repo.create(&mut conn, &user, true).await?; Ok(session)
} ...but this just looks like the login method, what's up? We now stray from the happy path.

