Imagine the above session_repo.create call failed and the function returned an error. A user would still be created, but they would receive no session and they wouldn't be granted application access. This might not be a big deal for our simple auth service since the user could just login and continue on with their life, but imagine things are not so simple. Imagine we have to execute multiple state changes to multiple repositories. When there are multiple pending state changes, we want to persist those changes only if all of them succeed, and conversely we want to revert all changes if any of them fail. For this we need transactions. In order to use transactions, we must devise a way for our driver, specifically its connection, to allow us to perform atomic queries with it. Most connections/db clients provide this out of the box with 3 simple methods: start_transaction commit_transaction rollback_transaction For this purpose, hextacy provides this functionality on any generic connection via the Atomic trait. Because transactions usually operate on the same connections, i.e. queries on a connection that started a transaction will all be executed within that transaction's context, we get the answer to the age old question of "Why put the C in the repository?". If our repository methods did not take in a C, then we would not be able to pass a transaction through multiple repository calls. We now update the register method to support transactions and isolate the creation of users and sessions to a neat little function. // marks lines added/changed. use hextacy::{Atomic, Driver}; #[async_trait]
impl<D, UR, SR> Authentication<D, UR, SR>
where D: Driver + Send + Sync, D::Connection: Atomic + Send, // UR: UserRepository<D::Connection> + UserRepository<<D::Connection as Atomic>::TransactionResult> + // Send + Sync, SR: SessionRepository<D::Connection> + SessionRepository<<D::Connection as Atomic>::TransactionResult> + // Send + Sync,
{ pub async fn register(&self, username: &str, password: &str) -> AppResult<Session> { let mut conn = self.driver.connect().await?; match self.user_repo.get_by_username(&mut conn, username).await { Ok(None) => {} Ok(Some(_)) => return Err(AuthenticationError::UsernameTaken.into()), Err(e) => return Err(e.into()), }; let hashed = hextacy::crypto::bcrypt_hash(password, 10)?; let mut tx = conn.start_transaction().await?; match self // .create_user_and_session(&mut tx, username, &hashed) .await { Ok(session) => { <Repo::Connection as Atomic>::commit_transaction(tx).await?; Ok(session) } Err(e) => { <Repo::Connection as Atomic>::abort_transaction(tx).await?; Err(e) } } } pub async fn create_user_and_session( // &self, tx: &mut <Repo::Connection as Atomic>::TransactionResult, username: &str, password: &str, ) -> AppResult<Session> { let user = self.user_repo.create(tx, username, password).await?; let session = self.session_repo.create(tx, &user, true).await?; Ok(session) }
} ...and in the 9th circle of generics hell we can observe the impenetrable wall of ultimate bounds I know, I know - who in their right mind would want to write all of this out? Our service has only 2 repositories and already half of our file is noisy generics. While we are reaping the benefit of having atomic queries we've stumbled upon another problem - boilerplate. We'll figure that one out in the next section, but first let's focus on how the code differs from our original implementation. Now, before we start with the state changes in our database we start a transaction. This is possible because we've bound the driver's connection to Atomic. When we get the results of create_user_and_session, we make sure to perform the necessary action on the transaction, ensuring the changes are only committed if everything was successful. This is where rust absolutely shines because we have total control on each of our interactions. One other thing to note for this approach is encapsulation. Since now the service is responsible for obtaining connections, one could argue that the driver does not belong in the service implementation logic since it is doing what is supposedly the repository's job. Repositories can be designed with no generics, as stated previously, and this would allow the service to completely remove the driver from its definition. This is a completely valid decision if one does not need atomicity in their queries and makes defining services with Box<dyn Repository> a great option. On the other hand, when we need transactions, the service always has the necessary context to reason about whether or not a transaction should succeed and should be left up to the service, in which case the C is unavoidable. In the next section we'll tear down the wall of generics and streamline the process of writing services using hextacy.

